import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M6.82 10.5l1 .87a.5.5 0 01-.66.76l-2-1.75a.5.5 0 010-.76l2-1.75a.5.5 0 01.66.76l-1 .87h3.68a.5.5 0 010 1H6.82zM18 14a2 2 0 01-2 2H4a2 2 0 01-2-2V6c0-1.1.9-2 2-2h12a2 2 0 012 2v8zm-6 1V5H4a1 1 0 00-1 1v8a1 1 0 001 1h8z", fill: primaryFill }));
};
const PanelRightExpand20Filled = wrapIcon(rawSvg({}), 'PanelRightExpand20Filled');
export default PanelRightExpand20Filled;
